import React from 'react'
import { useHistory } from 'react-router-dom'

export const Btn = () => {
    let history = useHistory();

    function handleClick() {
        history.push('/staff');
    }
    return (
        <div>
            <button onClick = {handleClick}>Staff</button>
            <button >estudiantes</button>
        </div>
    )
}
